import React from "react";
import { Routes, Route } from "react-router-dom";
import AboutPage from "../pages/AboutPage";
import AboutusPage from "../pages/AboutusPage";
import ContactPage from "../pages/ContactPage";
import HomePage from "../pages/HomePage";
import PortfolioPage from "../pages/PortfolioPage";
import MetalPage from "../pages/MetalPage";
import ProductPage from "../pages/ProductPage";
import EducationPage from "../pages/EducationPage";
import PimlerPage from "../pages/PimlerPage";
import VidalarPage from "../pages/VidalarPage";
import SomunlarPage from "../pages/SomunlarPage";

const CustomRoutes = () => {
  return (
    <Routes>
      <Route
        exact
        path="/Burc"
        element={<SomunlarPage />}
      />
      <Route
        path="/Pim"
        element={<PimlerPage />}
      />
    <Route exact path="/Civata" element={<cPage/>} />
    <Route exact path="/Education" element={<EducationPage />} />
      <Route exact path="/Product" element={<ProductPage />} />
      <Route exact path="/Metal" element={<MetalPage />} />
      <Route exact path="/Portfolio" element={<PortfolioPage />} />
      <Route path="/Contact" element={<ContactPage />} />
      <Route path="/Aboutus" element={<AboutusPage />} />
      <Route path="/About" element={<AboutPage />} />
      <Route path="/" element={<HomePage />} />
    </Routes>
  );
};

export default CustomRoutes;
